import React, { useEffect, useState } from 'react';

const VisionSummary = () => {
  const [achievements, setAchievements] = useState([]);
  const [insights, setInsights] = useState('');
  const [progressData, setProgressData] = useState({
    weekly: { progress: 0, summary: '' },
    monthly: { progress: 0, summary: '' },
    yearly: { progress: 0, summary: '' },
  });

  // טוען נתונים מ-Local Storage
  useEffect(() => {
    const savedSummary = localStorage.getItem('visionSummary');
    if (savedSummary) {
      const data = JSON.parse(savedSummary);
      setAchievements(data.achievements || []);
      setInsights(data.insights || '');
      setProgressData(data.progressData || {
        weekly: { progress: 0, summary: '' },
        monthly: { progress: 0, summary: '' },
        yearly: { progress: 0, summary: '' },
      });
    }
  }, []);

  // שמירת הנתונים
  const saveSummary = () => {
    const summaryData = {
      achievements,
      insights,
      progressData,
    };
    localStorage.setItem('visionSummary', JSON.stringify(summaryData));
    alert('💾 הסיכום נשמר בהצלחה!');
  };

  // איפוס הנתונים
  const resetSummary = () => {
    setAchievements([]);
    setInsights('');
    setProgressData({
      weekly: { progress: 0, summary: '' },
      monthly: { progress: 0, summary: '' },
      yearly: { progress: 0, summary: '' },
    });
    localStorage.removeItem('visionSummary');
    alert('🗑️ הסיכום נמחק בהצלחה!');
  };

  return (
    <div className="container mx-auto p-8 bg-white rounded-md shadow-md max-w-5xl">
      <h1 className="text-3xl font-bold mb-6 text-center">📊 סיכום שבועי, חודשי ושנתי 📊</h1>

      {/* הישגים עיקריים */}
      <section className="mb-8">
        <h2 className="text-xl font-bold mb-2">🏆 הישגים עיקריים</h2>
        <div className="border p-4 rounded-md bg-gray-50">
          <ul className="list-disc pl-6 mb-4">
            {achievements.map((achievement, index) => (
              <li key={index} className="mb-1 text-lg">{achievement}</li>
            ))}
          </ul>
          <input
            type="text"
            placeholder="הוסף הישג חדש..."
            className="w-full p-3 border rounded-md"
            onKeyDown={(e) => {
              if (e.key === 'Enter' && e.target.value) {
                setAchievements([...achievements, e.target.value]);
                e.target.value = '';
              }
            }}
          />
        </div>
      </section>

      {/* תובנות אישיות */}
      <section className="mb-8">
        <h2 className="text-xl font-bold mb-2">💡 תובנות אישיות</h2>
        <div className="border p-4 rounded-md bg-gray-50">
          <textarea
            value={insights}
            onChange={(e) => setInsights(e.target.value)}
            placeholder="כתוב כאן את התובנות שלך..."
            className="w-full h-48 p-3 border rounded-md resize-none"
          />
        </div>
      </section>

      {/* גרף התקדמות + סיכומים */}
      <section className="mb-8">
        <h2 className="text-xl font-bold mb-2">📈 התקדמות לעבר החזון</h2>

        {/* שבועי */}
        <div className="mb-4 border p-4 rounded-md bg-gray-50">
          <h3 className="text-lg font-semibold mb-2">🗓️ סיכום שבועי</h3>
          <input
            type="number"
            value={progressData.weekly.progress || 0}
            onChange={(e) =>
              setProgressData({
                ...progressData,
                weekly: { ...progressData.weekly, progress: e.target.value },
              })
            }
            className="w-full p-2 border rounded-md mb-2"
            max={100}
            min={0}
          />
          <p>{progressData.weekly.progress}% הושלמו</p>
          <textarea
            value={progressData.weekly.summary || ''}
            onChange={(e) =>
              setProgressData({
                ...progressData,
                weekly: { ...progressData.weekly, summary: e.target.value },
              })
            }
            placeholder="סיכום שבועי..."
            className="w-full h-32 p-2 border rounded-md resize-none mt-2"
          />
        </div>

        {/* חודשי */}
        <div className="mb-4 border p-4 rounded-md bg-gray-50">
          <h3 className="text-lg font-semibold mb-2">📅 סיכום חודשי</h3>
          <input
            type="number"
            value={progressData.monthly.progress || 0}
            onChange={(e) =>
              setProgressData({
                ...progressData,
                monthly: { ...progressData.monthly, progress: e.target.value },
              })
            }
            className="w-full p-2 border rounded-md mb-2"
            max={100}
            min={0}
          />
          <p>{progressData.monthly.progress}% הושלמו</p>
          <textarea
            value={progressData.monthly.summary || ''}
            onChange={(e) =>
              setProgressData({
                ...progressData,
                monthly: { ...progressData.monthly, summary: e.target.value },
              })
            }
            placeholder="סיכום חודשי..."
            className="w-full h-32 p-2 border rounded-md resize-none mt-2"
          />
        </div>

        {/* שנתי */}
        <div className="border p-4 rounded-md bg-gray-50">
          <h3 className="text-lg font-semibold mb-2">🏆 סיכום שנתי</h3>
          <input
            type="number"
            value={progressData.yearly.progress || 0}
            onChange={(e) =>
              setProgressData({
                ...progressData,
                yearly: { ...progressData.yearly, progress: e.target.value },
              })
            }
            className="w-full p-2 border rounded-md mb-2"
            max={100}
            min={0}
          />
          <p>{progressData.yearly.progress}% הושלמו</p>
          <textarea
            value={progressData.yearly.summary || ''}
            onChange={(e) =>
              setProgressData({
                ...progressData,
                yearly: { ...progressData.yearly, summary: e.target.value },
              })
            }
            placeholder="סיכום שנתי..."
            className="w-full h-32 p-2 border rounded-md resize-none mt-2"
          />
        </div>
      </section>
    </div>
  );
};

export default VisionSummary;
